## **SPARQL Query**

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>


SELECT DISTINCT ?patientId ?description ?birthdate ?first ?last ?gender ?address 
WHERE {  
  SYN:p1 a syn:Patient ; 
  syn:patientId ?patientId ;
  ?patientId syn:hasHistoryOf ?condition ;
  SYN:condition a syn:Condition ;
  syn:hasDiagnosed SYN:encounter1 ;
  SYN:encounter1 syn:description ?description;
  SYN:encounter1 syn:isPerformedAt SYN:org1;
  SYN:org1 a syn:Organization;
  SYN:org1 syn:name "Emergency Department";

  ?patientId syn:birthdate ?birthdate ;
  ?patientId syn:first ?first ;
  ?patientId syn:last ?last ;
  ?patientId syn:gender ?gender ;
  ?patientId  syn:address ?address
  FILTER (  
   ?description = "Acute bronchitis (disorder)"^^pl  
 )
}
```

## Explanation

* **PREFIXES:**
    * The query uses standard prefixes `rdf` and `rdfs`, and custom prefixes for the Sytheia ontology (`syn`), data types (`xsd`, `pl`), and IRI links (`cvx`, `udi`, `ct`,  `snomed`).
* **SELECT clause:**
    * Selects distinct values for the following attributes of the patient:
        * Patient ID (`?patientId`)
        * Description of the condition (`?description`)
        * Date of birth (`?birthdate`)
        * First name (`?first`)
        * Last name (`?last`)
        * Gender (`?gender`)
        * Address (`?address`)
* **WHERE clause:**
    * Defines the condition that needs to be met for the selected attributes to be included in the result.
    * This clause uses the following conditions:
        * **Patient `p1` has a history of condition `condition` with the description `Acute bronchitis (disorder)`**:
          * `SYN:p1 a syn:Patient ; syn:hasHistoryOf ?condition ; SYN:condition a syn:Condition ; syn:description = "Acute bronchitis (disorder)"^^pl`
        * This condition was diagnosed during encounter `encounter1`, which was performed at organization `Emergency Department`:
          * `?condition syn:hasDiagnosed SYN:encounter1 ; SYN:encounter1 syn:description ?description ; SYN:encounter1 syn:isPerformedAt SYN:org1 ; SYN:org1 a syn:Organization ; SYN:org1 syn:name "Emergency Department"`
        * Patient information is retrieved from patient `p1`:
          * `?patientId syn:patientId ?patientId ; ?patientId syn:birthdate ?birthdate ; ?patientId syn:first ?first ; ?patientId syn:last ?last ; ?patientId syn:gender ?gender ; ?patientId  syn:address ?address`
 * **FILTER clause:**
    * Further filters the results to include only patients with the condition "Acute bronchitis (disorder)".

