SELECT ?patientName ?encounterDateTime ?encounterType ?encounterDescription ?medicaidPayerId ?medicaidClaims ?medicaidClaimTransactions ?medicaidCoveredEncounters ?medicaidUncoveredEncounters 
WHERE { 
    ?patient syn:id <http://knacc.umbc.edu/dae-young/kim/ontologies/synthea#Patient_1> ; 
                 syn:first 'John'^^pl; 
                 syn:last 'Smith'^^pl.
    ?encounter a syn:Encounter ; 
                  syn:patientId ?patientId ; 
                  syn:id ?encounterId. 

     ?patient a syn:Patient; 
                  syn:id ?patientId;
                  syn:allergyId ?allergyId. 

     ?allergy syn:id ?allergyId; 
                  syn:code "102011008"^^xsd:string; 
                  syn:description "House Dust"^^pl;
                  syn:encounterId ?encounterId0. 

     ?encounter0 syn:id ?encounterId0; 
                    syn:encounterType "AMBULATORY"^^xsd:string; 
                    syn:startDate "20230322"^^xsd:string;
                    syn:encounterClass "AMBULATORY"^^xsd:string.

     # Medicaid Payer 
     {  ?medicaidPayer a syn:Payer; 
                 syn:name "Medicaid"^^pl; 
                 syn:id ?medicaidPayerId. } 
     UNION 
     {  ?patient syn:payerId ?medicaidPayerId. }


    ?medication syn:medicationDataProperty ct:387012004 ;
                      syn:patientId ?patientId;

    # Medicaid Claim 
    ?claim a syn:Claim ; 
              syn:encounterId ?encounterId ; 
              syn:id ?claimId ; 
              syn:payerId ?medicaidPayerId.


     # Medicaid Claim Transactions
     ?claimTransaction syn:claimTransactionId ?claimTransactionId ; 
                        syn:claimId ?claimId ; 
                        syn:payerId ?medicaidPayerId. 
     # Medicaid Covered Encounters 
     { ?encounter syn:isCoveredBy ?medicaidPayerId. 
          BIND (?encounter AS ?coveredEncounters) } 
     # Medicaid Uncovered Encounters 
     {  ?encounter syn:isNotCoveredBy ?medicaidPayerId. 
         BIND (?encounter AS ?uncoveredEncounters ) } 

     BIND(COALESCE (?coveredEncounters) AS ?medicaidCoveredEncounters) 
     BIND(COALESCE (?uncoveredEncounters) AS ?medicaidUncoveredEncounters) 

     BIND(COUNT(?claim) AS ?medicaidClaims)
     BIND(COUNT(?claimTransaction) AS ?medicaidClaimTransactions ) 


    BIND(?encounter as ?encountersResult)

} 
GROUP BY ?medicaidClaims ?medicaidClaimTransactions ?medicaidCoveredEncounters ?medicaidUncoveredEncounters

