PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT DISTINCT ?firstName ?lastName
WHERE {
  ?condition a syn:Condition ;
             syn:code "Diabetes mellitus"^^snomed: ;
             syn:patientId ?patientId.
  ?patient a syn:Patient; 
            syn:id ?patientId;
            syn:first ?firstName;
            syn:last ?lastName.
}
```

This query uses the `syn:Condition` class to find all conditions with the code "Diabetes mellitus". It then joins the results with `syn:Patient` using the `syn:patientId` property to identify the patients with those conditions. Finally, it selects the first and last names of the identified patients.

