## Query 2

**Question:** Find the total number of unique patients who had an encounter with a provider specializing in cardiology.

**SPARQL Query:**

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT DISTINCT (COUNT(DISTINCT ?patientId) AS ?count) WHERE {
  ?provider a syn:Provider ;
    syn:speciality 'Cardiology'^^pl: .
  ?encounter a syn:Encounter ;
    syn:providerId ?providerId ;
    syn:isPerformedBy ?provider .
  ?encounter syn:isAbout ?patient.
  ?patient a syn:Patient ;
    syn:id ?patientId .
}
```

## Query 3

**Question:** Get the names of all patients who had an allergy diagnosed during an encounter with a provider specializing in allergy and immunology.

**SPARQL Query:**

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT DISTINCT ?patientName WHERE {
  ?provider a syn:Provider ;
    syn:speciality 'Allergy/Immunology'^^pl: .
  ?encounter a syn:Encounter ;
    syn:providerId ?providerId ;
    syn:isPerformedBy ?provider .
  ?encounter syn:isDiagnosedDuring ?condition.
  ?condition a syn:Allergy ;
    syn:isAbout ?patient .
  ?patient a syn:Patient ;
    syn:first ?firstName^^pl: ;
    syn:last ?lastName^^pl: ;
  BIND (CONCAT(?firstName, ' ', ?lastName) AS ?patientName).
}
```

## Query 4

**Question:** Find all patients who have not had any encounters in the year 2020.

**SPARQL Query:**

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT DISTINCT ?patientId ?patientName WHERE {
  ?patient a syn:Patient ;
    syn:id ?patientId ;
    syn:first ?firstName^^pl: ;
    syn:last ?lastName^^pl: ;
  BIND (CONCAT(?firstName, ' ', ?lastName) AS ?patientName).
  FILTER NOT EXISTS {
    ?encounter a syn:Encounter ;
      syn:patientId ?patientId ;
      syn:startDateTime ?datetime .
    FILTER (year(?datetime) = 2020)
  }
}
```

