# Find the name of the provider associated with the encounter with ID "ddfad242-f4f7-52e8-7c2d-1615a97ba685".

SELECT ?name
WHERE {
  { 
    # Find an Encounter with the given encounterId.
    { 
      SELECT ?encounter ?providerId
      WHERE{
        ?encounter rdf:type syn:Encounter .
        OPTIONAL { ?encounter syn:id ?encounterId . } # Optional to account for cases where encounterId doesn't exist.  
        ?encounter syn:performedBy ?providerId  
      }
    } .
    # Given the encounter, find the associated Provider's name.
     ?provider a syn:Provider ; syn:id ?providerId.
    ?provider syn:name ?name  
  } UNION { # In case encounter has no provider, return empty
    ?encounter rdf:type syn:Encounter .
    OPTIONAL { ?encounter syn:id ?encounterId . } # Optional to account for cases where id doesn't exist.  
 }

  FILTER ?encounterId = uuid:"ddfad242-f4f7-52e8-7c2d-1615a97ba685"  
}  
